 Aqu√≠ tienes un ejemplo de c√≥digo en C++ para el ESP32 que lee las temperaturas de sensores 1-Wire DS18B20 y las muestra en el monitor serial. Aseg√∫rate de que tus sensores est√©n correctamente conectados a los pines del ESP32 y que el bus 1-Wire est√© correctamente configurado.

