 Aqu√≠ tienes el algoritmo Bubble Sort implementado en C:

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    int i, j, temp;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) {
                // Intercambiar los elementos si el primero es mayor que el segundo
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

void imprimirArray(int arr[], int n) {
    int i;
    for (i=0; i < n; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Arreglo ordenado:\n");
    imprimirArray(arr, n);
    return 0;
}
```

Este programa define una funci√≥n `bubbleSort` que ordena un arreglo de enteros utilizando el algoritmo de ordenamiento por inserci√≥n. La funci√≥n `imprimirArray` se utiliza para imprimir el arreglo ordenado. En el `main` se crea un arreglo de ejemplo y se ordena utilizando la funci√≥n `bubbleSort`.

