  - `arr`: el array `map()` actualizado que contiene el elemento actual.
- `thisValue` (opcional): un valor que se pasa a la funci√≥n como su valor `this`.

Veamos un ejemplo pr√°ctico:

```javascript
// Creamos un array de n√∫meros
