 Here is a JavaScript function that checks if an array of 5 numbers contains a prime number. If a prime number is found, it prints the number to the console.

```javascript
function isPrime(num) {
    if (num < 2) return false;
    for (let i = 2; i <= Math.sqrt(num); i++) {
        if (num % i === 0) return false;
    }
    return true;
}

function findPrimeInArray(arr) {
    for (let i = 0; i < arr.length; i++) {
        if (isPrime(arr[i])) {
            console.log(arr[i]);
            return;
        }
    }
}

let arr = [1, 2, 3, 4, 5];
findPrimeInArray(arr);
```

In this code, `isPrime` function checks if a number is prime or not. It returns `false` if the number is less than 2 or if it's divisible by any number up to its square root.

`findPrimeInArray` function iterates over the array and checks each number if it's prime using `isPrime` function. If a prime number is found, it logs the number to the console and stops further execution.

